import axios from "axios";

function Home () {

    axios.get('https://pokeadpi.co/api/v2/pokemon?limit=50')
    .then(pokemonList => console.log(pokemonList))
    .catch(error => console.log(error));

	return (
        <div>
            Home
        </div>
    );
}

export default Home;
